  MSK_axpy:
    comments: performs y = a*x + y where x/y are vectors.
  MSK_gemv:
    comments: calculates y = aAx + by, where A is matrix, x,y is vector, and a b are scalars.
  MSK_dot:
    last_param_outupt: true
    comments: performs a dot product of two vectors
  MSK_gemm:
    comments: |
      performs a general matrix multiplication
      C = alpha * A * B + beta * C
  MSK_potrf:
    comments: performs Cholesky decomposition of symmetric square matrix a
  MSK_syrk:
    comments: performs rank k update of matrix C, C = aAA^T + bC where A/C is matrix and a, b are scalars.
  MSK_syeig:
    comments: calculates the eigen values of a symmetric matrix.
  MSK_syevd:
    comments: calculates the eigen values and eigen vectors of a symmetric matrix.
